import React from 'react'
import styled from "styled-components"
import PropTypes from 'prop-types';

const NavContainer = styled.div`
    width: 100%;
    height: 80px;
    background-color: #F6F9FC;
    font-family: 'Lato', sans-serif;
    color: #111439;
`

const NavContentContainer = styled.div`
    width: 1100px;
    padding-top: 30px;
    margin-left: 50%;
    transform: translateX(-50%);
    display: flex;
`

const NavName = styled.h4`
    font-size: 16px;
    font-weight: 300;
    font-style: italic;
`

const NavNameBold = styled.span`
    font-weight: 600;
`

const NavEmoji = styled.span`
    font-style: normal;
    margin-left: 6px;
    font-size: 16px;
`

const NavLinkContainer = styled.div`
    position: absolute;
    right: 0;
`

const NavLinkList = styled.ul`
    display: flex;
    list-style: none;
    font-size: 14px;
    font-weight: 300;
    margin-top: 3px;
`

const NavLink = styled.li`
    margin-left: 40px;
`

const NavBtn = styled.a`
    text-decoration: none;
    color: #111439;
    &:hover {
        color: #0503EE;
        transition: 0.1s;
    }
`

export default function NavBar (theme, toggleTheme) {
    return (
    <NavContainer>
            <NavContentContainer>
                <NavName><NavNameBold>Ben</NavNameBold> DiMarco</NavName>
                <NavLinkContainer>
                    <NavLinkList>
                        <NavLink><NavBtn href={"#"}>About Me</NavBtn></NavLink>
                        <NavLink><NavBtn href={"#"}>My Projects</NavBtn></NavLink>
                        <NavLink><NavBtn href={"#"}>Get In Touch</NavBtn></NavLink>
                        <NavLink><NavBtn onClick={toggleTheme()}><i class="fas fa-moon"></i></NavBtn></NavLink>
                    </NavLinkList>
                </NavLinkContainer>
            </NavContentContainer>
        </NavContainer>
    )
}

NavBar.propTypes = {
    toggleTheme: PropTypes.func,
    theme: PropTypes.object
};
